const url = 'https://api.rasp.yandex.net/v3.0/search/?apikey=4947ef3f-adeb-4221-93ec-743762d9d209&format=json&from=c146&to=c213&lang=ru_RU&page=1&date=2018-11-29';
const proxyurl = "https://cors-anywhere.herokuapp.com/";

fetch(proxyurl + url, {
  method: 'POST', // or 'PUT'
  headers:{
    'Access-Control-Allow-Origin': 'http://192.168.0.8:3000',
    'Content-Type': 'application/json',
    'Access-Control-Allow-Methods': 'POST',
    'Authorization': '4947ef3f-adeb-4221-93ec-743762d9d209'
  }
}).then(res => res.json())
.then(response => console.log('Success:', JSON.stringify(response)))
.catch(error => console.error('Error:', error));
